import React from 'react'
import ReactDOM from 'react-dom';

let time = new Date().getHours();

let Greet = " ";

if (time >= 1 && time < 12) {
    Greet = "Good Morining";
    Greet.color ="red"
}
else if (time > 12 && time < 19) {
    Greet = "Good Afternoon";
    Greet.color ="red"

}
else {
    Greet = "Good Evening";
}



ReactDOM.render(

    <>
        <h1 >Hello Sir {Greet}</h1>
    </>,
    document.getElementById('root')



);
